    on 11a that were made for expenses related to independent expenditure and/or other
    disbursements and are not operating expenditures.  FECfile automatically creates
    an expense on line 21b for ever in kind entered, but several of these are for
    expenses that may be itemized on lines 24 adn 29.  All contributors who have given
    more than 200 calendar year to date and who did not provide employer and occupation
    information have been contacted to obtain this information.  Once the information
    is received, the Committee will amend its reports to disclose the updated information.
    \  Amended to disclose additional donor information per FEC letter dated 4/24/14.\n"
